import { Layout, Space } from 'antd';
import './App.css';
import AppHeader from './components/AppHeader/header';
import AppFooter from './components/AppFooter/footer';
import PageContent from './components/PageContent/PageContent';
import SideMenu from './components/SideMenu/dashboard';


function App() {
  return (
    <div className="App">
      <div>
        <AppHeader />
        <Space>
          <SideMenu></SideMenu>
          <PageContent />
        </Space>
        <AppFooter></AppFooter>

      </div>


    </div>
  );
}

export default App;
